import React from 'react'
import styled from 'styled-components';

import SearchIcon from '@mui/icons-material/Search';

const Title = styled.h2`
width: 380px;
border-bottom: 3px solid rgb(3, 28, 28);
font-family: sans-serif;
letter-spacing: 0.1em;
`
const Container = styled.div`
margin-left:30px;
flex:1;
margin:5px;
min-width:280px;
height:350px;
display:flex;
align-items:center;
justify-center:center;
background-color: white;
position:absolute;


`
const Circle = styled.div`
    width:200px;
    height:200px;
    border-radius:50%;
    background-color: white;
    position:absolute;
`
const Image = styled.img`
    height:75%;
    z-index:2;
`
const Info = styled.div`
width:100%;
height:100%;
position:absolute;
top:0;
left:0;
background-color:bray;
z-index:3;
display:flex:
align-items:center;
justify-content:center;


`
const Icon = styled.div`
    width:40px;
    height:40px;
    border-radius:50%;
    background-color:white;
    dispaly:flex;
    align-items:center;
    justify-content:center;
    margin:10px;
`


const List = ({item}) => {
    return (
        
        <div>
            
            <Container>
               <Circle/>
               <Image src={item.img}/>
               <Info>
                   <Icon>
                  <SearchIcon/>
                   </Icon>
             
               </Info>
            </Container>
        </div>
    )
}

export default List
